import Home from "./pages/Home";
import Setting from "./pages/Setting";
import ErrorPage from "./pages/ErrorPage";
import Layout from "./layout";
import { Router } from "@reach/router";

/**
 * @description - App Root.
 * @returns {Node} - App Root.
 */
function App() {
  return (
