    //       <Route path="/home" element={<Home />}></Route>
    //       <Route path="/*" element={<ErrorPage />}></Route>
    //     </Routes>
    //   </Layout>
    // </Router>
    <Layout>
      <Router basename="/theme-app">
        <Setting path="/" />
        <Home path="/home" />
        <ErrorPage path="/*" />
      </Router>
    </Layout>
  );
}

export default App;
